import "./App.css";
import NavBar from "./components/Navbar";
import { BrowserRouter as Router } from "react-router-dom";
import SideBar from "./components/SideBar";

function App() {
  return (
    <div>
      <Router>
        <SideBar />
        <NavBar />
      </Router>
    </div>
  );
}

export default App;
